import React from "react";
import { Route, Switch } from "react-router";
import WelcomeScreen from "../Components/WelcomeScreen";

function Routes() {
  return (
    <div>
      <Switch>
        <Route exact path="/">
          <WelcomeScreen />
        </Route>

        <Route exact path="/">
          <WelcomeScreen />
        </Route>
      </Switch>
    </div>
  );
}

export { Routes };
